  false,\n\t\"url\": null,\n\t\"notes\": \"The Natural Resources Science Plan aims
  to provide the information to effectively implement the Papahanumokuakea Marine
  National Monument Management Plan. The Natural Resources Science Plan for Papahanaumokuakea
  Marine National Monument (Monument) prioritizes the research needed to inform management
  decision-making in the Monument, and it builds on extensive discussions, planning,
  and prioritization efforts conducted over the last 5 years. The Plan is based on
  the best available information and data, drawn from the published literature, reports,
  the Monument permit database, expert consultations, and the Monument Management
  Plan. The Science Plan was developed by a sciences planning team composed of Monument
  managers, scientists, and other designated Co-trustee representatives. Researchers
  from academic and research institutions can use the Science Plan to focus their
  research proposals on topics that are relevant to the management needs of the Monument.\",\n\t\"license_title\":
